import React from 'react';
import '../../App.css';
import Cards from '../Cards';

function Projects() {
  return (
      <>
          <div className='fun'>
            <h1 className='fun-main'>OTHER WORK</h1>
            <h1 className='fun-small'>Experimentation with a variety of mediums</h1>
          </div>
          <Cards />
      </>
  );
}

export default Projects;
